INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (10040, 102601, 1, 0, 24001, "あたしだって\nやるときはやるよ！", "2020/04/30 12:00:00", 1, 24, 0.0, 0.0, "2030/12/17 14:59:59", 0.0, "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (10040, 102601, 1, 1, 24002, "ふぅ…\nこれであたしの仕事は\n終わりだね", "2020/04/30 12:00:00", 1, 24, 0.0, 0.0, "2030/12/17 14:59:59", 0.0, "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (10040, 102601, 1, 2, 24003, "終わった終わった\n一人でもなんとか\nなるもんだね", "2020/04/30 12:00:00", 1, 24, 0.0, 0.0, "2030/12/17 14:59:59", 0.0, "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (10040, 102601, 2, 3, 24004, "やったね！\nこれでようやく\nサボれるよ…", "2020/04/30 12:00:00", 2, 24, 0.0, 0.0, "2030/12/17 14:59:59", 0.0, "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (10040, 102601, 1, 4, 24005, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", "2020/04/30 12:00:00", 1, 24, 0.0, 0.0, "2030/12/17 14:59:59", 0.0, "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (10040, 102601, 2, 5, 24006, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", "2020/04/30 12:00:00", 2, 24, 0.0, 0.0, "2030/12/17 14:59:59", 0.0, "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (10040, 102601, 2, 6, 24007, "あたしも意外と\nやるもんでしょ？", "2020/04/30 12:00:00", 2, 24, 0.0, 0.0, "2030/12/17 14:59:59", 0.0, "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (10040, 102601, 4, 7, 24008, "疲れた…\nねずみの逃げ足\n速すぎるよ…", "2020/04/30 12:00:00", 4, 24, 0.0, 0.0, "2030/12/17 14:59:59", 0.0, "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (10040, 102601, 4, 8, 24009, "このままじゃ\nまっひ～に\n叱られちゃうよ", "2020/04/30 12:00:00", 4, 24, 0.0, 0.0, "2030/12/17 14:59:59", 0.0, "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (10040, 102601, 4, 9, 24010, "まじめに\nやったんだけどな…\n悔しいな～", "2020/04/30 12:00:00", 4, 24, 0.0, 0.0, "2030/12/17 14:59:59", 0.0, "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (10040, 102601, 4, 10, 24011, "やられた…\nねずみって意外と\nてごわいね", "2020/04/30 12:00:00", 4, 24, 0.0, 0.0, "2030/12/17 14:59:59", 0.0, "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (10040, 102601, 4, 11, 24012, "おのれ～\nあたしのチーズを\n盗みやがって～！", "2020/04/30 12:00:00", 4, 24, 0.0, 0.0, "2030/12/17 14:59:59", 0.0, "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (10040, 102601, 1, 12, 24013, "疲れた…\nけど、次こそは\n守り抜くよ…", "2020/04/30 12:00:00", 4, 24, 0.0, 0.0, "2030/12/17 14:59:59", 1.81, "リン");
